import React from "react";
import "./HeaderOption.css";
import { Avatar } from "@material-ui/core";
import { useSelector } from "react-redux";
//import { selectUser } from "./features/userSlice";

function HeaderOption({ avatar, Icon, title, onClick }) {
  // const user = useSelector(selectUser);

  return (
    <div onClick={onClick} className="headerOption">
      {Icon && <Icon className="headerOption__icon" />}
      {avatar && (
        <Avatar
          className="headerOption__icon"
          src={
            "https://media-exp1.licdn.com/dms/image/C4D03AQGDiWuWWd12MA/profile-displayphoto-shrink_200_200/0/1617837846595?e=1635379200&v=beta&t=mrhHf9x3j2LoDQEwjJeDs0wzl7iOqeVWioy-vbzCxPg"
          }
        ></Avatar>
      )}
      <h3 className="headerOption__title d-none d-md-inline">{title}</h3>
    </div>
  );
}

export default HeaderOption;
